using System;
using System.Buffers.Text;
using System.Collections.Generic;
using System.Drawing;
using System.IO;
using System.Linq;
using Android.Support.V7.Widget;
using Android.Views;
using Android.Widget;
using Shoolin.Appify.App.ViewHolders;
using Shoolin.Appify.Core.Models;
using Shoolin.Appify.Core.UseCases;

namespace Shoolin.Appify.App.Adapters
{
    public class WishListAdapter: RecyclerView.Adapter
    {
        private readonly IReadOnlyCollection<Whiskey> _wishListWhiskeys;
        public event EventHandler<int> ItemClick;

        public WishListAdapter(IWishListWhiskeyUseCase wishListWhiskeyUseCase, ulong userId)
        {
            _wishListWhiskeys = wishListWhiskeyUseCase.Get(userId);
        }

        public override void OnBindViewHolder(RecyclerView.ViewHolder holder, int position)
        {
            if (!(holder is WishListViewHolder wishListViewHolder)) return;

            var bytes = GetImageBytes();
            var bitmap = Android.Graphics.BitmapFactory.DecodeByteArray(bytes, 0, bytes.Length);
            wishListViewHolder.WhiskeyImageView.SetImageBitmap(bitmap);
            wishListViewHolder.WhiskeyNameTextView.Text = _wishListWhiskeys.ElementAt(position).Name;
            wishListViewHolder.DistilleryNameTextView.Text = _wishListWhiskeys.ElementAt(position).Distiller;
            wishListViewHolder.AbvTextView.Text = $"{_wishListWhiskeys.ElementAt(position).Abv} % alcohol by volume";
        }

        private byte[] GetImageBytes()
        {
            var base64String = "";

            return Convert.FromBase64String(base64String);
            //using var ms = new MemoryStream(bytes);
            //var image = Image.FromStream(ms);
            
            //return new Bitmap(image);
        }

        public override RecyclerView.ViewHolder OnCreateViewHolder(ViewGroup parent, int viewType)
        {
            View itemView =
                LayoutInflater.From(parent.Context).Inflate(Resource.Layout.wishlist_viewholder, parent, false);

            WishListViewHolder wishListViewHolder = new WishListViewHolder(itemView, OnClick);
            return wishListViewHolder;
        }

        private void OnClick(int position)
        {
            var whiskeyId = _wishListWhiskeys.ElementAt(position).Id;
            ItemClick?.Invoke(this, (int)whiskeyId);
        }

        public override int ItemCount => _wishListWhiskeys.Count;
    }
}